import styled, { css } from "styled-components";
import Title from "/src/components/ui/title/title";

export const StyleSection = styled.section`
  width: 100%;
  padding: 100px ${(props) => props.theme.pagePadding};
  background-color: ${(props) => props.theme.colorFormBackground};

  display: grid;
  grid-template-columns: 1fr 1fr;
  column-gap: 100px;
`;

export const StyledTitle = styled(Title)`
  grid-area: 1/1/2/-1;
  margin-bottom: 24px;
`;

export const StyleForm = styled.form`
  width: 100%;
  background-color: ${(props) => props.theme.colorWhite};
  border-radius: 20px;
  padding: 40px;
  display: grid;
  gap: 20px;
`;

export const StyleFieldset = styled.div`
  border: none;
`;

export const StyleLegend = styled.p`
  font-weight: 700;
  font-size: 18px;
  line-height: 150%;
`;

export const UL = styled.ul`
  margin: 0;
  padding: 0;
  list-style: none;

  display: flex;
  gap: 10px;
`;

export const StyleRadioClock = styled.span`
  display: inline-flex;
  justify-content: center;
  align-items: center;
  width: 44px;
  height: 44px;

  border-radius: 8px;
  transition: color 0.2s ease-out, background-color 0.2s ease-out;

  cursor: pointer;
  user-select: none;
  ${(props) =>
    props.$isChecked
      ? css`
          background-color: #ff732b;
          color: #ffffff;
        `
      : css`
          background-color: #f7f7f7;
          color: #333333;
        `}
`;

export const UlRate = styled.ul`
  margin: 0;
  padding: 0;
  list-style: none;

  display: flex;
  flex-direction: column;
  gap: 5px;
`;

export const LiRate = styled.li`
  display: grid;
  grid-template-columns: 1fr auto;
  padding: 10px 20px;
  background-color: #f6f6f6;
  border-radius: 10px;
`;

export const StyleRadioRate = styled.span`
  display: block;

  padding-left: 26px;
  position: relative;

  cursor: pointer;
  user-select: none;
  transition: color 0.2s ease-out, background-color 0.2s ease-out;

  &::after {
    content: "";
    width: 18px;
    height: 18px;
    position: absolute;
    top: 0;
    left: 0;
    border: 1px solid #ff732b;
    border-radius: 50%;
  }

  &::before {
    content: "";
    position: absolute;
    top: 4px;
    left: 3px;
    border-radius: 50%;
    ${(props) =>
      props.$isChecked
        ? css`
            background-color: #ff732b;
            width: 12px;
            height: 12px;
          `
        : css`
            display: none;
          `}
  }
`;

export const ButtonRate = styled.div`
  position: absolute;
  bottom: 0;
  left: 0;
  right: 0;
`;

export const InputTotal = styled.input`
  border: none;
  pointer-events: none;
  font-size: 24px;

  &:focus-visible {
    outline: none;
  }
`;

export const StyleImg = styled.div`
  width: 447px;
  height: 409px;
  background-size: 100% 100%;
  background-repeat: no-repeat;
  background-image: url("data:image/png;base64,");
`;
